import { Redirect, Route, BrowserRouter, Switch } from 'react-router-dom';
import {
  IonApp,
  IonRouterOutlet,
  setupIonicReact,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar
} from '@ionic/react';
import { IonReactRouter } from '@ionic/react-router';

/* Core CSS required for Ionic components to work properly */
import '@ionic/react/css/core.css';

/* Basic CSS for apps built with Ionic */
import '@ionic/react/css/normalize.css';
import '@ionic/react/css/structure.css';
import '@ionic/react/css/typography.css';

/* Optional CSS utils that can be commented out */
import '@ionic/react/css/padding.css';
import '@ionic/react/css/float-elements.css';
import '@ionic/react/css/text-alignment.css';
import '@ionic/react/css/text-transformation.css';
import '@ionic/react/css/flex-utils.css';
import '@ionic/react/css/display.css';

/* Theme variables */
import './theme/variables.css';
/// **component***
import Login from './pages/Login';
import AdminLayout from './pages/AdminLayout';
import UserLayout from './pages/UserLayout';
import Group from './components/Group';
import TrashArticle from './components/TrashArticle';
import Quiz from './components/quiz/Quiz';
import QuizLevel from './components/quiz/QuizLevel';
import Question from './components/quiz/Question';

setupIonicReact();

const App: React.FC = () => (
  <IonApp>
    <IonReactRouter>
      <IonRouterOutlet>
        <Route exact path="/login">

        </Route>
        <Route exact path="/">
          <Redirect to="/login" />
        </Route>
        <>
          <BrowserRouter >
            <Switch>

              <Route exact path="/login" component={Login} />
              <Route path="/dashboard" component={AdminLayout} />
              <Route path="/group" component={Group} />
              <Route path="/trash" component={TrashArticle} />
              <Route path="/quiz" component={Quiz} />
              <Route path="/quizlevel" component={QuizLevel} />
              <Route path="/question" component={Question} />
              <Route path='/blog' component={UserLayout} />

            </Switch>
          </BrowserRouter>

        </>
      </IonRouterOutlet>
    </IonReactRouter>
  </IonApp>
);

export default App;
